ink next to each block to configure its specific title and visibility settings. Use the <a href=\"@add-block\">add block page</a> to create a custom block.','6.26'),(622,'/admin/build/block','default','Blocks are boxes of content rendered into an area, or region, of a web page. The default theme Garland, for example, implements the regions \"left sidebar\", \"right sidebar\", \"content\", \"header\", and \"footer\", and a block may appear in any one of these areas. The <a href=\"@blocks\">blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions.','6.26'),(623,'/admin/build/block','default','Although blocks are usually generated automatically by modules (like the <em>User login</em> block, for example), administrators can also define custom blocks. Custom blocks have a title, description, and body. The body of the block can be as long as necessary, and can contain content supported by any available <a href=\"@input-format\">input format</a>.','6.26'),(624,'/admin/build/block','default','When working with blocks, remember that:','6.26'),(625,'/admin/build/block','default','since not all themes implement the same regions, or display regions in the same way, blocks are positioned on a per-theme basis.','6.26'),(626,'/admin/build/block','default','disabled blocks, or blocks not in a region, are never shown.','6.26'),(627,'/admin/build/block','default','when throttle module is enabled, throttled blocks (blocks with the <em>Throttle</em> checkbox selected) are hidden during high server loads.','6.26'),(628,'/admin/build/block','default','blocks can be configured to be visible only on certain pages.','6.26'),(629,'/admin/build/block','default','blocks can be configured to be visible only when specific conditions are true.','6.26'),(630,'/admin/build/block','default','blocks can be configured to be visible only for certain user roles.','6.26'),(631,'/admin/build/block','default','when allowed by an administrator, specific blocks may be enabled or disabled on a per-user basis using the <em>My account</em> page.','6.26'),(632,'/admin/build/block','default','some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','6.26'),(633,'/admin/build/block','default','For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','6.26'),(634,'/admin/build/block','default','[<a href=\"@link\">more help...</a>]','6.26'),(635,'/admin/build/block','default','The block settings have been updated.','6.26'),(636,'/admin/build/block','default','Popular searches','6.26'),(637,'/aggregator','default','aggregator','6.26'),(638,'/aggregator','default','OPML feed','6.26'),(639,'/aggregator','default','Sources','6.26'),(640,'/admin/content','default','Story','6.26'),(641,'/admin/content/comment','default','Update options','6.26'),(642,'/admin/content/comment','default','Unpublish the selected comments','6.26'),(643,'/admin/content/comment','default','Delete the selected comments','6.26'),(644,'/admin/content/comment','default','Update','6.26'),(645,'/admin/content/comment','default','Subject','6.26'),(646,'/admin/content/comment','default','Posted in','6.26'),(647,'/admin/content/comment','default','Time','6.26'),(648,'/admin/content/comment','default','No comments available.','6.26'),(649,'/admin/content/comment','default','sort by @s','6.26'),(650,'/admin/content/comment','default','sort icon','6.26'),(651,'/admin/content/comment','default','sort ascending','6.26'),(652,'/admin/content/comment','default','Published comments','6.26'),(653,'/admin/content/comment','default','Approval queue','6.26'),(654,'/admin/content/comment','default','Below is a list of the latest comments posted to your site. Click on a subject to see the comment, the author\'s name to edit the author\'s user information, \'edit\' to modify the text, and \'delete\' to remove their submission.','6.26'),(655,'/admin/content/comment','default','The comment module allows visitors to comment on your posts, creating ad hoc discussion boards. Any <a href=\"@content-type\">content type</a> may have its <em>Default comment setting</em> set to <em>Read/Write</em> to allow comments, or <em>Disabled</em>, to prevent comments. Comment display settings and other controls may also be customized for each content type (some display settings are customizable by individual users).','6.26'),(656,'/admin/content/comment','default','Comment permissions are assigned to user roles, and are used to determine whether anonymous users (or other roles) are allowed to comment on posts. If anonymous users are allowed to comment, their individual contact information may be retained in cookies stored on their local computer for use in later comment submissions. When a comment has no replies, it may be (optionally) edited by its author. The comment module uses the same input formats and HTML tags available when creating other forms of content.','6.26'),(657,'/admin/content/comment','default','For more information, see the online handbook entry for <a href=\"@comment\">Comment module</a>.','6.26'),(658,'/admin/settings/apachesolr','default','Solr host name','6.26'),(659,'/admin/settings/apachesolr','default','Host name of your Solr server, e.g. <code>localhost</code> or <code>example.com</code>.','6.26'),(660,'/admin/settings/apachesolr','default','Solr port','6.26'),(661,'/admin/settings/apachesolr','default','Port on which the Solr server listens. The Jetty example server is 8983, while Tomcat is 8080 by default.','6.26'),(662,'/admin/settings/apachesolr','default','Solr path','6.26'),(663,'/admin/settings/apachesolr','default','Path that identifies the Solr request handler to be used.','6.26'),(664,'/admin/settings/apachesolr','default','Number of items to index per cron run','6.26'),(665,'/admin/settings/apachesolr','default','The maximum number of items indexed in each pass of a <a href=\"@cron\">cron maintenan